.wrapper {
    padding: 1rem;
    min-height: calc(100vh - 2rem);
  }
  .wrapper h1,
  .wrapper p {
    color: var(--light) !important;
  }
  .wrapper a {
    color: var(--accent) !important;
  }
  .wrapper * {
    font-family: var(--ui-font);
  }
  .wrapper .bg {
    filter: grayscale(1) invert(0.5) opacity(0.2);
  }
  .wrapper [class *= 'box'] {
    background-color: var(--dark) !important;
    border-radius: 4px;
    box-shadow: inset 0 0 0 1px var(--darker), var(--bshadow);
  }
  .wrapper [class *= 'box'] .text-switch {
    color: var(--lighter) !important;
  }
  .wrapper [class *= 'box'] [class *= 'toggle'] + label {
    background-color: var(--darker) !important;
  }
  .wrapper [class *= 'box'] [class *= 'toggle'] + label::after {
    background-color: var(--darker) !important;
  }
  .wrapper [class *= 'box'] [class *= 'toggle'] + label::before {
    background-color: var(--dark) !important;
  }
  .wrapper [class *= 'box'] [class *= 'toggle']:checked + label::before {
    background-color: var(--blue) !important;
  }

/** Original colors
  white-1 - fff
  white-2 - f6f8fa
  white-3 - e1e4e8
  white-4 - d1d5da
  white-5 - eaecef
  white-6 - dfe2e5
  white-7 - ccc
  black-1 - 24292e
  black-2 - 6a737d
  black-3 - 586069
  black-4 - 444d56
  blue-1 - 0366d6
  blue-2 - eaf5ff
  blue-3 - f1f8ff
  blue-4 - def
*/

:root {
  --white-1: #1e2022;
  --white-2: #303234;
  --white-3: #454647;
  --white-4: #616161;
  --white-5: #3a3c3d;
  --white-6: #524f4f;
  --white-7: #767676;
  --black-1: #dfdfdf;
  --black-2: #b2b6bb;
  --black-3: #d1d5da;
  --black-3: #b5bac1;
  --black-4: #969a9f;
  --blue-1: #559cf8;
  --blue-2: #27364a;
  --blue-3: #263242;
  --blue-4: #34465f;
  --blue-5: #405675;

  --box-shadow: #5d5d5d26;

  /* Syntax highlighting */
  --s-background: #282c34;
  --s-context: #2c313a;

  --s-chalky: #e5c07b;
  --s-coral: #e06c75;
  --s-cyan: #56b6c2;
  --s-error: #f44747;
  --s-ivory: #abb2bf;
  --s-malibu: #61afef;
  --s-sage: #98c379;
  --s-stone: #5c6370;
  --s-violet: #c678dd;
  --s-whiskey: #d19a66;
}

body {
  background-color: var(--white-1);
  color: var(--black-1);
}

.rule, hr {
  border-color: var(--white-6);
}

.form-hr {
  border-color: var(--white-5);
}

kbd {
  background-color: var(--white-2);
  border-color: var(--white-4);
  box-shadow: inset 0 -1px 0 var(--white-4);
  color: var(--black-4);
}

/** Backgrounds */
.bg-white {
  background-color: var(--white-1) !important;
}

.bg-gray,
.bg-gray-light {
  background-color: var(--white-2) !important;
}

.bg-gray-2 {
  background-color: var(--white-3) !important;
}

.bg-blue {
  background-color: var(--blue-1) !important;
}

.bg-blue-light {
  background-color: var(--blue-3) !important;
}

/** Links */
.link-gray-dark {
  color: var(--black-1) !important;
}

.muted-link,
.link-gray {
  color: var(--black-3) !important;
}

a,
.btn-link,
.btn-octicon:hover {
  color: var(--blue-1);
}

.muted-link:hover,
.link-gray:hover,
.link-gray-dark:hover,
.link-hover-blue:hover {
  color: var(--blue-1) !important;
}

/** Text */
.text-emphasized {
  color: var(--black-1);
}

.text-gray-light {
  color: var(--black-2) !important;
}

.color-gray-9,
.text-gray-dark {
  color: var(--black-1) !important;
}

.text-gray,
.note {
  color: var(--black-3) !important;
}

.bg-blue-2 {
  color: var(--white-1);
}

.text-blue {
  color: var(--blue-1) !important;
}

/** Borders */
.border,
.border-bottom,
.border-right,
.border-top,
.border-left {
   border-color: var(--white-3) !important;
}

.border-gray-dark {
  border-color: var(--white-4) !important;
}

.border-gray-light {
  border-color: var(--white-5) !important;
}

@media (min-width: 1012px) {
  .border-lg-left {
    border-color: var(--white-3) !important
  }
}

@media (min-width: 768px) {
  .border-md,
  .border-md-top {
    border-color: var(--white-3) !important;
  }
}

/** Buttons */
.btn:not(.btn-primary) {
  border-color: var(--white-6);
}

.btn:not(.btn-primary):not(.btn-outline) {
  background-color: var(--white-3);
  background-image: linear-gradient(-180deg, #696464, var(--white-6) 90%);
  color: var(--black-1);
}

.btn:not(.btn-primary):not(.btn-outline).hover,
.btn:not(.btn-primary):not(.btn-outline):hover {
  background-color: var(--white-4);
  background-image: linear-gradient(-180deg, #635e5e, #4d4b4b 90%);
  border-color: var(--white-4);
}

.btn-outline {
  background-color: var(--white-1);
  color: var(--blue-1);
}

.btn-outline.disabled,
.btn-outline:disabled,
.btn-outline[aria-disabled=true] {
  background-color: var(--white-1);
  border-color: var(--white-3) !important;
  color: var(--black-4);
}

.btn-outline.selected,
.btn-outline:active,
.btn-outline:hover,
.btn-outline[aria-selected=true],
[open] > .btn-outline {
  border-color: #0366d6;
}

.btn-danger {
  background-image: linear-gradient(-180deg, #cb2431, #941a24 90%) !important;
  border-color: #b31a26 !important;
  color: #fff !important;
}

.btn-danger:hover {
  background-color: #cb2431;
  background-image: linear-gradient(-180deg, #de4450, #cb2431 90%) !important;
}

/** Forms */
::placeholder {
  color: var(--black-2);
}

.form-control,
.form-select {
  background-color: var(--white-1);
  border-color: var(--white-4);
  color: var(--black-1);
}

.form-group .form-control,
.input-contrast {
  background-color: var(--white-2);
}

.form-group .form-control:focus,
.input-contrast:focus {
  background-color: var(--white-1);
}

/** Header */
.pagehead {
  border-color: var(--white-3);
}

.gh-header {
  background-color: var(--white-1);
}

.gh-header-meta {
  border-color: var(--white-3);
  color: var(--black-3);
}

.gh-header-number {
  color: var(--black-2);
}

.Subhead {
  border-color: var(--white-3);
}

.repohead h1 {
  color: var(--black-3);
}

.Header-link {
  color: #fff;
}

.Counter {
  background-color: #fff2;
  color: var(--black-3);
}

.breadcrumb strong.final-path {
  color: var(--black-1);
}

.pagehead-actions > li {
  color: var(--black-1);
}

/** Boxes */
.Box {
  background-color: var(--white-1);
  border-color: var(--white-4);
}

.Box-header {
  background-color: var(--white-2);
  border-color: var(--white-4);
}

.Box-header--blue {
  background-color: var(--blue-3);
  border-color: var(--blue-4);
}

.Box-row--blue {
  background-color: var(--blue-3);
}

.Box-row {
  border-color: var(--white-3);
}

.Box-row--hover-blue:hover {
  background-color: var(--blue-3);
}

.Box-row--focus-gray.navigation-focus {
  background-color: var(--white-2);
}

.Box-body {
  border-color: var(--white-3);
}

.Box-footer {
  border-color: var(--white-3);
}

.Box--danger,
.Box--danger .Box-body:last-of-type,
.Box--danger .Box-row:first-of-type {
  border-color: #d73a49;
}

/** Tables */
.table-list-header {
  background-color: var(--white-2);
  border-color: var(--white-3);
}

.table-list-header-toggle .btn-link:hover,
.table-list-header-toggle .btn-link.selected,
.table-list-header-toggle .btn-link.selected:hover {
  color: var(--black-1);
}

.table-list-header-toggle .btn-link {
  color: var(--black-3);
}

.table-list {
  border-color: var(--white-3);
  color: var(--black-2);
}

/** Dashboard activity */
.AvatarStack-body {
  background-color: var(--white-1);
}

.AvatarStack--right .avatar {
  border-color: var(--white-1);
}

.news div.message,
.news li blockquote {
  color: var(--black-3);
}

.dashboard-rollup-items > .dashboard-rollup-item {
  border-color: var(--white-3);
}

.commit-desc pre {
  color: var(--black-4);
}

.team-mention,
.user-mention {
  color: var(--black-1);
}

/** Popovers */
.SelectMenu-modal {
  background-color: var(--white-2);
}

@media (min-width: 544px) {
  .SelectMenu-modal {
    border-color: var(--white-4);
  }
}

.SelectMenu-list {
  background-color: var(--white-1);
  border-color: var(--white-3);
}

.SelectMenu-item {
  background-color: var(--white-1);
  border-color: var(--white-3);
  color: var(--black-3);
}

.SelectMenu-item[aria-checked=true] {
  color: var(--black-1);
}

@media (hover: hover) {
  .SelectMenu-item:hover,
  body:not(.intent-mouse) .SelectMenu-item:focus {
    background-color: var(--white-2);
  }
}

.SelectMenu-divider {
  background-color: var(--white-2);
  color: var(--black-2);
  border-color: var(--white-5);
}

.SelectMenu-filter {
  border-color: var(--white-3);
}

.SelectMenu-footer {
  border-color: var(--white-3);
  color: var(--black-2);
}

.SelectMenu-tab {
  color: var(--black-2);
}

.SelectMenu-tab[aria-selected=true] {
  background-color: var(--white-1);
  color: var(--black-1);
}

@media (min-width: 544px) {
  .SelectMenu-tab[aria-selected=true] {
    border-color: var(--white-3);
  }
}

@media (hover: hover) {
  .SelectMenu-tab:not([aria-checked=true]):active,
  .SelectMenu-tab:not([aria-checked=true]):hover {
    background-color: var(--white-1);
  }

  .SelectMenu-tab:not([aria-selected=true]):hover {
    background-color: var(--white-3);
    color: var(--black-1);
  }
}

.SelectMenu-blankslate,
.SelectMenu-loading,
.SelectMenu-message {
  background-color: var(--white-1);
}

.SelectMenu-message {
  border-color: var(--white-5);
}

/** Popover */
.Popover-message:after {
  border-bottom-color: var(--white-1);
}

.Popover-message:before {
  border-bottom-color: var(--white-4);
}

.Popover-message--bottom-left:after,
.Popover-message--bottom-left:before,
.Popover-message--bottom-right:after,
.Popover-message--bottom-right:before,
.Popover-message--bottom:after,
.Popover-message--bottom:before {
  border-bottom-color: transparent;
}

.Popover-message--bottom-left:after,
.Popover-message--bottom-right:after,
.Popover-message--bottom:after {
  border-top-color: var(--white-1);
}

.Popover-message--bottom-left:before,
.Popover-message--bottom-right:before,
.Popover-message--bottom:before {
  border-top-color: var(--white-4);
}

/** Load more button */
.ajax-pagination-form .ajax-pagination-btn {
  background-color: var(--white-1);
  border-color: var(--white-3);
  color: var(--blue-1);
}

.ajax-pagination-form .ajax-pagination-btn:focus,
.ajax-pagination-form .ajax-pagination-btn:hover {
  background-color: var(--white-2);
  color: var(--blue-1);
}

/** Login page. Note that I did deviate from matching the original styles
exactly. Instead I picked values that were close to the original to maintain
the consistent color palette. */
.session-authentication {
  background-color: var(--white-2);
}

.session-authentication .auth-form-header,
.session-authentication .header-logo {
  color: var(--black-1);
}

.session-authentication .auth-form-body {
  background-color: var(--white-1);
  border-color: var(--white-4);
}

.session-authentication .create-account-callout {
  border-color: var(--white-4);
}

/** Tags */
.branch-name {
  background-color: var(--blue-2);
  color: var(--blue-1);
}

a.branch-name {
  color: var(--blue-1);
}

.topic-tag,
.topic-tag-action {
  background-color: var(--blue-3);
}

.topic-tag-link:hover {
  background-color: var(--blue-4);
}

.delete-topic-button,
.delete-topic-link {
  background-color: var(--blue-3);
  border-color: var(--blue-4);
  color: var(--black-2);
}

.delete-topic-button:hover,
.delete-topic-link:hover {
  background-color: var(--blue-4);
}

/** Repo navigation */
.reponav-item {
  color: var(--black-3);
