/* Disable */
  div:not(.bp) {
    background: transparent !important;
    background-color: transparent;
  }

  /* Text */
  div.u-textColorNormal, h1.u-textColorDark, p, span, div, figcaption, li, a, h1, h2, h3, h4 {
    color: #f8f8f2 !important;
  }

  /* Root */
  body {
    background-color: #282a36 !important;
    color: #f8f8f2 !important;
  }

  /* Popup */
  .bp {
    background-color: #282a36 !important;
    box-shadow: rgba(0, 0, 0, 0.3) 0px 0px 20px !important;
  }

  /* Logo */
  svg, .aw, .ax {
    fill: #f8f8f2 !important;
  }

  /* Buttons */
  button {
    border-color: #f8f8f2 !important;
  }

  button:selected {
    color: #f8f8f2 !important;
  }

  /* Navigation */
  nav {
    background-color: #6a737d33 !important;
    backdrop-filter: blur(10px) saturate(125%);
    padding-bottom: 5px;
  }

  .gist .highlight {
    background: #333;
  }

  .gist .blob-code, .gist .blob-num {
    color: #7a81a9;
  }

/* ==UserStyle==
@name         Wikipedia Deep Dark Theme
@version      1.0.0
@description  Dark Wikipedia theme. Get a cleaner, easier-to-read wiki at night to focus on content while browsing a beautiful dark website.
@namespace    http://www.w3.org/1999/xhtml
@author       n0x
@homepageURL  https://github.com/n0x-styles/wikipedia-dark
@supportURL   https://github.com/n0x-styles/wikipedia-dark/issues
@updateURL    https://raw.githubusercontent.com/n0x-styles/wikipedia-dark/master/wikipedia-dark.user.css
@license      CC0
@preprocessor default
==/UserStyle== */

@namespace url(http://www.w3.org/1999/xhtml);

body {
        font-family: "Helvetica Neue", Helvetica, Arial, sans-serif !important;
        color: #ddd;
        background-color: #222 !important;
    }

    a,
    .tocnumber {
        color: #608dff !important;
        text-decoration: none;
    }

    a:hover {
        color: #637ab5 !important;
        text-decoration: underline;
    }
  
    .b, div, th {
    color : white !important;
    }

    h1 {
        border: 0px !important;
        font-family: 'Arial' !important;
        font-weight: 700 !important;
        font-size: 36px !important;
        color: #fff !important;
    }

    h2 {
        border: 0px !important;
        font-family: 'Arial' !important;
        font-weight: 400 !important;
        font-size: 26px !important;
        color: #eee !important;
    }

    h3 {
        border: 0px !important;
        font-family: 'Arial' !important;
        font-weight: 400 !important;
        font-size: 16px !important;
        color: #ddd !important;
    }

    h4 {
        color: #ccc !important;
    }

    [style*="color: black"] {
        color: white !important;
    }

    [style*="background:#f8f9fa"] {
        background: #2d2c2b !important;
        border: none !important;
    }

    .reflist,
    .refbegin {
        background-color: #282828 !important;
    }

    .thumbcaption {
        color: #888 !important;
    }

    #content h3 {
        font-size: 20px !important;
    }

    p {
        font-weight: 300 !important;
        line-height: 1.7 !important;
        color: #ddd !important;
    }

    .portal-column-right span,
    .portal-column-left span,
    body.ns-100 .mw-body-content h2,
    .mw_metadata th,
    .tracklist th,
